function findBreakpoints(config, initialThreshold, subsequentThreshold) {
  let sum = 0;
  let breakpoints = [];
  let currentThreshold = initialThreshold;
  let thresholdSwitched = false; // Flag to switch threshold after first use

  config.forEach((item, index) => {
    // Check if adding the next height would exceed the current threshold
    if (sum + item.height >= currentThreshold) {
      breakpoints.push({ index: index - 1, sum: sum }); // Save the last index before exceeding the threshold and the sum
      sum = item.height; // Reset sum to current item height

      // Switch to the subsequent threshold after the first breakpoint
      if (!thresholdSwitched) {
        currentThreshold = subsequentThreshold;
        thresholdSwitched = true;
      }
    } else {
      sum += item.height; // Otherwise, add to the current sum
    }
  });

  // Add the last segment if it doesn't exceed the threshold but isn't empty
  if (sum > 0 && sum < currentThreshold) {
    breakpoints.push({ index: config.length - 1, sum: sum });
  }

  return breakpoints;
}

